import { useNavigate, Link } from 'react-router-dom'

import '../styles/header.css'

function Header(){

    let navigate = useNavigate();

    function openStore(){
        navigate("/store"); 
    }

    return(

        <div className = 'header'>
            <Link to = '/about'></Link>
            <h1 onClick = {openStore}>Store</h1>
            <h1>About</h1>
        </div>

    )
}
export {Header}
